import React from 'react';
import './LoginPage.css'; // Ensure this is properly linked to your component

const LoginPage = () => {
  return (
    <div className="login-container">
      <h1 className="login-title">EasyTrucking</h1>
      <p className="login-subtitle">Sign up to access driving features</p>
      <form className="login-form">
        <div className="input-wrapper">
          <input type="email" placeholder="Enter your email" id="email" name="email" required />
        </div>
        <div className="input-wrapper">
          <input type="password" placeholder="Create a password" id="password" name="password" required />
        </div>
        <button type="submit" className="login-button">Join now</button>
        <div className="login-footer">
          Already a member? <a href="/login" className="login-link">Log In</a>
        </div>
      </form>
    </div>
  );
};

export default LoginPage;
